class Solution {
	fun findAnagrams(s: String, p: String): List<Int> {
		if (s.length < p.length)
			return emptyList()

		val pMap = subStringToMap(p)
		val result = mutableListOf<Int>()

		var i = 0
		while (i < s.length - p.length + 1) {
			if (pMap.containsKey(s[i])) {
				val delta = p.length
				val subS = s.substring(i, i + delta)
				val subSMap = subStringToMap(subS)
				if (subSMap.size == pMap.size && areMapEquals(pMap, subSMap)) {
					result.add(i)
				}
			}
			i++
		}
		return result
	}

	private fun subStringToMap(s: String): HashMap<Char, Int> {
		val pHashMap = hashMapOf<Char, Int>()
		for (c in s) {
			pHashMap[c] = (pHashMap[c] ?: 0) + 1
		}
		return pHashMap
	}

	private fun areMapEquals(a: HashMap<Char, Int>, b: HashMap<Char, Int>): Boolean {
		for (i in a) {
			if (i.value != b[i.key])
				return false
		}
		return true
	}
}